                    "Goal": "Increase awareness of the Microsoft Azure platform to take on AWS.",
                    "Why_UXDX": "UXDX attracted the key CTO's and decision makers that Microsoft needed.",
                    "Approach": "We produced an invite-only, bespoke, 2 hour CIO/CTO lunch to discuss “Trust and Security in the Cloud”, where executives from aviation, government and leading tech giants gathered.",
