                    "Goal": "Shopify were expanding their APAC office and wanted to promote the job opportunities available.",
                    "Why_UXDX": "UXDX attracts the same Product Manger, UX researchers, designers and developer roles that Shopify were looking for. ",
                    "Approach": "Shopify partnered with UXDX to offer a number of free tickets to UXDX. In addition, their virtual booth allowed people to watch specifically chosen videos and to engage directly with the recruitment team. ",
                    "Outcome": "The social media campaign for Shopify attracted a lot of interest and gained a lot of goodwill for the company.\n\nThe virtual booth allowed interested people to learn more about the work that Shopify do and their way of working which delivered higher quality leads. ",
